import React from "react";

const Tasks = ({todos , setTodos}) =>{


    return(
      <div>

          {todos.map((todo)=>(
 
 
 <div class="task" key={todo.id}>
 
 
   <span class="icon-star icon" 
>
    
     </span>
 
 
   <p  class="task-text"></p>



 
 
   <div>
 
 
     <span class="icon-trash icon" 
 
 
 > </span>



 
 
     <span className="icon-file_done icon" > </span>
 
 
   </div> 
 
 
  </div>

          )
          
          )}


          
      </div>
      
    );
   
}

export default Tasks
